import React from 'react';

class Searchbox extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			filter: '',
		}
	}
	onTextChange = (event) => {
		this.setState({textCahnge: event.target.value})
	}

	render() {
		return (
			<div>
				<textarea>
				</textarea>
			</div>
		)
	}
}

export default Searchbox;
